let pagination = (props)=>{
return(
  <nav style={{'width': '100%','padding-left': '40%'}}>
    <ul className ={classes.pagination}style = {{'list-style':'none','display': 'flex','padding-left': '0','border-radius': '.25rem'}}>
      <li style={{'position': 'relative','display': 'block','padding': '.5rem .75rem',
                'margin-left': '-1px','line-height': '1.25','color': '#007bff','background-color': '#fff',
                'border': '1px solid #dee2e6'}}>
          1
      </li>
      <li style={{'position': 'relative','display': 'block','padding': '.5rem .75rem',
                'margin-left': '-1px','line-height': '1.25','color': '#007bff','background-color': '#fff',
                'border': '1px solid #dee2e6'}}>
          2
      </li>
      <li style={{'position': 'relative','display': 'block','padding': '.5rem .75rem',
                'margin-left': '-1px','line-height': '1.25','color': '#007bff','background-color': '#fff',
                'border': '1px solid #dee2e6'}}>
        3
        </li>
      <li style={{'position': 'relative','display': 'block','padding': '.5rem .75rem',
                'margin-left': '-1px','line-height': '1.25','color': '#007bff','background-color': '#fff',
                'border': '1px solid #dee2e6'}}>
        4
      </li>
    </ul>
  </nav>
)
}
export default pagination;
